const Suggestions = (props) => {
    const options = props.results.map((x, y) => (
        <li key={y}>{x[y].title}</li>
    ))

    if (props.results[0]) { console.log(props.results[0].title)}

    return <ul>{options}</ul>;
       
    
}

export default Suggestions
